REPLACE INTO `mob_chat_db` VALUES(1, 16711680, 'Fraco! Me desafie se tiver alguma coragem!');
REPLACE INTO `mob_chat_db` VALUES(2, 16711680, 'Impressionante! Eu me pergunto até onde sua imprudencia irá levá-lo.');
REPLACE INTO `mob_chat_db` VALUES(3, 16711680, 'Tenho pena de você estar contra mim. Agora se prepare para meu ataque!');
REPLACE INTO `mob_chat_db` VALUES(4, 16711680, 'Meus servos fiéis! O recebam com uma morte dolorosa!');
REPLACE INTO `mob_chat_db` VALUES(5, 16711680, 'Não fuja!');
REPLACE INTO `mob_chat_db` VALUES(6, 16711680, 'Vocês, humanos inúteis. Seus poderes sagrados não tem efeito sobre mim!');
REPLACE INTO `mob_chat_db` VALUES(7, 16711680, 'Subalternos inúteis!... Tudo bem, eu tenho mais armas descartáveis para usar.');
REPLACE INTO `mob_chat_db` VALUES(8, 16711680, 'Reze para seus deuses!');
REPLACE INTO `mob_chat_db` VALUES(9, 16711680, 'Você ainda acha que é um jogo para mim?');
REPLACE INTO `mob_chat_db` VALUES(10, 16711680, 'Desapareça!');
REPLACE INTO `mob_chat_db` VALUES(11, 16711680, 'Vamos ver por quanto tempo você pode agüentar meu poder!');
REPLACE INTO `mob_chat_db` VALUES(12, 16711680, 'Isso é tudo que você tem?');
REPLACE INTO `mob_chat_db` VALUES(13, 16711680, 'Você está me fazendo cócegas!');
REPLACE INTO `mob_chat_db` VALUES(14, 16711680, 'Chama isso de ataque? Assista e aprenda, seus fracos!');
REPLACE INTO `mob_chat_db` VALUES(15, 16711680, 'É hora de terminar o jogo!');
REPLACE INTO `mob_chat_db` VALUES(16, 16711680, 'Ha! Você é mais forte do que eu pensava!');
REPLACE INTO `mob_chat_db` VALUES(17, 16711680, 'Não! Isso não poder estar acontecendo! Eu sou Satan Morroc, o Rei da Destruição!');
REPLACE INTO `mob_chat_db` VALUES(18, 16711680, 'Eu nunca morrei! Sempre estarei voltando para lhe pegar!');
REPLACE INTO `mob_chat_db` VALUES(19, 16711680, 'Eu nasci para conquistar este mundo! Nada poderá me impedir!');
REPLACE INTO `mob_chat_db` VALUES(20, 16711680, 'Seus dias estão contados!');
REPLACE INTO `mob_chat_db` VALUES(21, 16711680, 'Strike! Meus dedos dilaceradores de aço!');
REPLACE INTO `mob_chat_db` VALUES(22, 16711680, 'Hahaha! Me diga quem sou! Eo sou Bafomé! O herdeiro do inferno!');
REPLACE INTO `mob_chat_db` VALUES(23, 16711680, 'Aproveite sua vida enquanto pode! Sua esperança em breve irá se transformar em desespero!');
REPLACE INTO `mob_chat_db` VALUES(24, 16711680, 'Quando você aprenderá a lição? Quando morrer?');
REPLACE INTO `mob_chat_db` VALUES(25, 16711680, 'Não... Eu não posso perder! Não vou implorar por minha vida! Eu não estou fugindo! Eu não aceito isso como derrota!');
REPLACE INTO `mob_chat_db` VALUES(26, 16711680, 'Argh... Eu... Eu, estou enfraquecendo...');
REPLACE INTO `mob_chat_db` VALUES(27, 16711680, 'O que você quer de mim?');
REPLACE INTO `mob_chat_db` VALUES(28, 16711680, 'Não! Eu não fiz isso! Ele é quem planejou tudo isso!');
REPLACE INTO `mob_chat_db` VALUES(29, 16711680, 'Eu só queria encontrar a paz..!  É por isso que eu estava fugindo!');
REPLACE INTO `mob_chat_db` VALUES(30, 16711680, 'Ahhhh!!! Agora, só tenho que matá-lo!');
REPLACE INTO `mob_chat_db` VALUES(31, 16711680, 'Moscas irritantes!! Saiam de mim!');
REPLACE INTO `mob_chat_db` VALUES(32, 16711680, 'Sofra no Inferno!');
REPLACE INTO `mob_chat_db` VALUES(33, 16711680, 'Muahahaha! Sinta a fúria da terra!!!');
REPLACE INTO `mob_chat_db` VALUES(34, 16711680, 'Não... Eu não irei aceitar esta derrota!');
REPLACE INTO `mob_chat_db` VALUES(35, 16711680, 'Será que me bater irá aliviar a sua solidão? Por que você não fica aqui comigo para sempre, humano?');
REPLACE INTO `mob_chat_db` VALUES(36, 16711680, 'Você esqueceu o significado do tempo. Eu me pergunto quanto tempo você poderá durar aqui...');
REPLACE INTO `mob_chat_db` VALUES(37, 16711680, 'Existe alguém esperando por você? Desista de tudo, você é meu agora...');
REPLACE INTO `mob_chat_db` VALUES(38, 16711680, 'Esqueça sua vida e fique confinado aqui. Você vai desejar a liberdade preso em cativeiro cativeiro !!');
REPLACE INTO `mob_chat_db` VALUES(39, 16711680, 'Quais serão as mudanças no mundo exterior, enquanto você estiver aqui na solidão durante mil anos?');
REPLACE INTO `mob_chat_db` VALUES(40, 16711680, 'Sim! Desejar a sua liberdade neste local confinado, sua permanência aqui será eterna !!');
